import React from "react";
import "./style.css";

function Hero() {
  return (
    <div className="jumbotron text-left">
      <h1 className="display-2">Google Books API Search</h1>
      <h3 className="lead">Utizing MERN</h3>
      <h4>Search for and save books from the Google Books API</h4>
    </div>
  );
}

export default Hero;
